import React, {Component} from 'react'
import {connect} from 'react-redux'
import {
    HomeWrap,
    HomeBanner
} from './style'
class Home extends Component{
    render(){
        return (
            <HomeWrap>
                <HomeBanner>
                    <img  />
                </HomeBanner>
            </HomeWrap>
        )
    }
}
export default connect(null, null)(Home)
